function init() -- entry point for this compile script
  -- prepare move and stat arrays. there are 252 moves and 252 pokemon, so they match perfectly.
  local movearr = {}
  for arr in all(datastr_to_arr(move_stats)) do
    local pkmnid, pow, typ, acc, pp = unpack(arr)
    movearr[pkmnid] = {pow, typ, acc, pp}
  end

  local statarr = {}
  for arr in all(datastr_to_arr(pokemon_stats)) do
