    local pkmnid, prevolve, type1, type2, hp, att, def, spd, sat, sdf, gender, color, item = unpack(arr)
    statarr[pkmnid] = {prevolve, type1, type2, hp, att, def, spd, sat, sdf, gender | item}
  end

  local data_ind = 1
  for i=0,251 do
    for x in all(movearr[i]) do offsetpoke(x) end
    for x in all(statarr[i]) do offsetpoke(x) end

    while g_data[data_ind] ~= 255 do
      offsetpoke(g_data[data_ind])
      data_ind += 1
    end

    offsetpoke(g_data[data_ind])
